function LoginLGC(s,t,e){s.loginUser=()=>{const o=s.states.loginUrl,r=e.extractFormData("loginFrm");s.states.loginError=!1,s.states.progress.login=e.setProgressMessage("Authenticating..."),t.post(o,r).then(t=>{console.log(t.data),!0===t.data.success?(token=t.data.msg.token,email=t.data.msg.email,s.states.loginError=!1,s.states.progress.login=e.setProgressMessage("Redirecting..."),window.location=s.states.loginRedirect+"/"+email+"/"+token):(s.states.loginError=!0,s.states.progress.login=e.setErrorMessage(t.data.msg))},t=>{console.log(t),s.states.progress.login=e.setErrorMessage(t.statusText)})}}